exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefWrappedRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.shukw.com/book/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/id="list"[^>]*>/,"</dl>").subLastIndexOf("\u5168\u90E8\u7AE0\u8282"),recordRegex:hrefWrappedRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};